import { BrowserRouter, Routes, Route } from 'react-router-dom';
import today from './pages/today';

const App = () => {
	return (

			<BrowserRouter>
				<Routes>
					<Route path="/today" element={<today/>}/>
					{/* 상단에 위치하는 라우트들의 규칙을 모두 확인, 일치하는 라우트가 없는경우 처리 */}
				</Routes>
			</BrowserRouter>

	);
};

export default App;
